"226644":{"id":"226644","name":"A Vida e os Segredos das Irmãs Sozahdahs","slug":"a-vida-e-os-segredos-das-irmas-sozahdahs","original_title":"Secrets & Sisterhood: The Sozahdahs","overview":"Este novo reality show segue dez irmãs muçulmanas americanas cuja fé e laços são colocados à prova enquanto tentam navegar as expectativas culturais, suas carreiras e encontrar amor em Los Angeles.","first_air_date":"2023-06-07","episode_run_time":0,"vote_average":8.3,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":["Half Yard Productions"],"genres":["Reality"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/6ku1cZB02KQxXRHiulJmfimincF.jpg","poster_path":"https://image.tmdb.org/t/p/original/5n27yYFIiSixgmNQGBY4C8hGo54.jpg","cast":["Shakur Sozahdah","Jamila Sozahdah","Hamida Sozahdah","Nooreya Sozahdah","Siddiqa Sozahdah"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/5n27yYFIiSixgmNQGBY4C8hGo54.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/5n27yYFIiSixgmNQGBY4C8hGo54.jpg","air_date":"2023-06-07","episode_count":10,"overview":"N/A","vote_average":3.1,"episodes":{"1":{"name":"Conheça as Sozahdahs","overview":"Acompanhe dez irmãs muçulmanas americanas lidando com amor, família e cultura. Shakur organiza uma festa de Eid após quase se divorciar, Hamida está guardando segredos e Jamila recebe uma notícia chocante que pode dividir sua família.","air_date":"2023-06-07","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/6mt5Du5usHEs3bW9FWnIvx34TJ0.jpg","vote_average":7},"2":{"name":"Segredos Revelados","overview":"Preocupada com as irmãs, Khadija organiza um jantar em família. Noor revela que está pronta para dar o próximo passo com o namorado. Hamida surpreende a todos ao revelar uma grande novidade. As irmãs de Shakur confrontam seu marido sobre o que ele a fez passar.","air_date":"2023-06-07","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/lEwSho6EfLjFm0EgKALyDHZKfa0.jpg","vote_average":6.3},"3":{"name":"Festa & Oração","overview":"As garotas planejam uma festa de aniversário para Noor, mas Shakur e Rabya têm uma briga feia que acaba estragando a festa. Jamila recebe más notícias e pede apoio às irmãs, mas descobre que nem todo mundo quer oferecer um ombro amigo.","air_date":"2023-06-07","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/vqjtyz31VmTJsLXh8ZQXOcXrRZV.jpg","vote_average":5.8},"4":{"name":"A Festa Acabou","overview":"Noor culpa Siddiqa pelo drama em sua festa de aniversário. Jamila e Shakur percebem que podem apoiar uma à outra, mesmo que não concordem. Mamãe quer viajar para a fronteira entre o Afeganistão e o Paquistão, mas as irmãs se preocupam com sua segurança.","air_date":"2023-06-07","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/cb28bG46rZSpJA9ni6NHRoZpmwo.jpg","vote_average":4},"5":{"name":"Controladora","overview":"As irmãs surpreendem Jamila em seu encontro. A pressão cultural afeta Hamida. Shakur e seu marido fazem um pacto para fazer terapia e renovarem seus votos. Jamila e Siddiqa planejam um evento, mas as coisas dão errado.","air_date":"2023-06-07","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/bQpYS0vnoVOzNkFWyOKbpSlBw4r.jpg","vote_average":3},"6":{"name":"Óvulos Reserva","overview":"As garotas marcam de sair, mas o marido de Shakur vai junto. Hamida faz uma cirurgia e se sente sufocada pelas irmãs. Jamila e Siddiqa querem congelar seus óvulos e, possivelmente, usar doadores de esperma, mas temem que sua mãe não aprove.","air_date":"2023-06-07","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/h1AAvPJRgqNFJoK6Zzr4bZn0VWm.jpg","vote_average":1},"7":{"name":"A Viagem Que Não Deu Certo","overview":"As irmãs fazem uma viagem para Sonoma, mas as coisas rapidamente fogem do controle quando todas irritam Shakur. Hamida desaparece e só Noor sabe onde ela está. Shakur fala sobre seu trauma na terapia de casal.","air_date":"2023-06-07","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/sgUXddTnXakZGeFYKtNNQpkc58F.jpg","vote_average":1},"8":{"name":"Viajando","overview":"Os nervos estão à flor da pele após uma briga entre Shakur e suas irmãs, mas um brunch “especial” ajuda a diminuir a tensão. Jamila finalmente revela seu grande segredo para suas irmãs, mas nem todas aceitam bem.","air_date":"2023-06-07","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/m7nEtd4YcE14kWQzshffF2SBbC2.jpg","vote_average":1},"9":{"name":"Lembrancinhas Legais, Vibe Ruim","overview":"Shakur diz a verdade ao seu marido e teme que ele esteja chateado. As garotas fazem tatuagens e organizam uma sessão de fotos de família. Shakur e Khadija fazem as pazes após se desentenderem, mas acabam brigando na frente de sua mãe.","air_date":"2023-06-07","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/dz07XB4QftE8zcMM8jASFAkDuLZ.jpg","vote_average":1},"10":{"name":"Família Acima de Tudo","overview":"O comportamento das irmãs deixa a mamãe decepcionada e ela já não sabe se quer ir à festa beneficente. O grande dia chega, e Jamila e Siddiqa se perguntam se a geração mais velha irá comparecer. Será que o evento será um sucesso?","air_date":"2023-06-07","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/rrxfykZRVQkcz9PWAYKsp1qLJgm.jpg","vote_average":1}}}}},
