"86546":{"id":"86546","name":"Radiante","slug":"radiante","original_title":"눈이 부시게","overview":"Kim Hye Ja (Han Ji Min é uma mulher jovem e otimista que sonha em se tornar âncora em um programa de notícias na TV. Seus planos são desfeitos quando ela de repente vira uma mulher de 70 anos! Enquanto isso, Lee Joon Ha (Nam Joo Hyuk), quer se tornar um repórter. Ele trabalhou duro para realizar seu sonho, mas agora ele vive em uma realidade decepcionante. O que acontecerá quando se encontrarem e descobrirem o verdadeiro significado de tempo?","first_air_date":"2019-02-11","episode_run_time":67,"vote_average":7.6,"number_of_seasons":1,"number_of_episodes":12,"created_by":["김석윤","Lee Nam-kyu","Kim Soo-jin"],"production_companies":["SLL","DramaHouse"],"genres":["Drama","Comédia"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/jJpuarfLx4DJjZ88nzXkHOuKvYX.jpg","poster_path":"https://image.tmdb.org/t/p/original/wKhwxc5SCEL4qK34SeCqPO08UhE.jpg","cast":["한지민","김혜자","남주혁","손호준","안내상"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qYSiAt63naS82XbC17suZjeMK6k.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qYSiAt63naS82XbC17suZjeMK6k.jpg","air_date":"2019-02-11","episode_count":12,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Com 20 e poucos anos e desempregada, Kim Hye-ja não faz muita coisa da vida até conhecer o aspirante a repórter Lee Jun-ha.","air_date":"2019-02-11","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/9S4fluG1Lg2rjgeKuBjtOZrAkiP.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Depois de uma inesperada tragédia familiar, Hye-ja resolve usar um relógio mágico que pode fazê-la voltar no tempo.","air_date":"2019-02-12","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/qvFxlMTVsqUnxld0AYulgEyzhZj.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Hye-ja luta para aceitar sua nova vida como idosa, assim como seus pais. Jun-ha enfrenta uma dura perda.","air_date":"2019-02-18","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/evmVCRwBtFQwHYs55Na8HSlsOvM.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Hye-ja tenta buscar seu cachorro na casa de Jun-ha. Kim Yeong-su não tem condições de pagar pela comida que pede de Lee Hyeon-ju.","air_date":"2019-02-19","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/hcvJUfFsgTt0ZjcJRWc3O28In2e.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Hye-ja não entende por que Jun-ha abandonou a carreira de repórter para trabalhar em um lugar que dá golpe em idosos.","air_date":"2019-02-25","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/5ums8N5zf2h0fWJ6MUw6MeItvG6.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"O canal de Yeong-su consegue atrair mais público. Frustrado com sua situação, Jun-ha revela a Hye-ja parte da dor que carrega.","air_date":"2019-02-26","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/A155x59Tjd1NzxTvayPpM7ikAcM.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Hye-ja fica esperançosa ao ver seu relógio sendo usado por outra pessoa. Hyeon-ju enfrenta um troll no canal de Yeong-su.","air_date":"2019-03-04","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/pS1Qiuy28TSqQTEBVGfMVUHST7D.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Chanel se prepara para visitar o filho, mas Jun-ha tem uma má notícia. Hyeon-ju não gosta quando Yeong-su conta ao público que ele foi seu primeiro amor.","air_date":"2019-03-05","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/mycieRrmZP1fPuCW0aYMH3uMm01.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"Enquanto a polícia interroga Jun-ha sobre suas últimas visitas a Chanel, Hye-ja se pergunta onde ela pode estar.","air_date":"2019-03-11","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/5uhHzJw66TLZTiiqiiA8KGf42sy.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Hye-ja bola um plano para salvar o dia quando suspeita que Jun-ha corre perigo devido a uma fraude de seguros.","air_date":"2019-03-12","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/croI8uwuRPQfJABhYqvQWkgKxhb.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"Hye-ja volta à realidade. Ela pensa em quando costumava ser uma jovem romântica e despreocupada que só queria seu primeiro beijo com Jun-ha.","air_date":"2019-03-18","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/fAUlOwlMcVQ7izdMXo8wBzMOxa6.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"Jun-ha se mete em apuros e estraga sua felicidade doméstica com Hye-ja. Lee Dae-sang percebe o amor de sua mãe por ele.","air_date":"2019-03-19","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/hymaGQAqtdHSXxrLccKdxtGh6Rm.jpg","vote_average":0}}}}},
