"131305":{"id":"131305","name":"Celebrity","slug":"celebrity","original_title":"셀러브리티","overview":"Seo A-ri conquista sucesso, fama e poder nas redes sociais da noite para o dia. Mas logo descobre que o glamoroso mundo dos influenciadores pode ter consequências mortais.","first_air_date":"2023-06-30","episode_run_time":45,"vote_average":7.7,"number_of_seasons":1,"number_of_episodes":12,"created_by":["김철규","Kim Yi-young"],"production_companies":["Studio Dragon","Kim Jong-hak Production","How Pictures"],"genres":["Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/ggOukDTllje9G36qKuXJtzMcRRT.jpg","poster_path":"https://image.tmdb.org/t/p/original/8ByqUYXl132OltM7066YY527Y6w.jpg","cast":["박규영","강민혁","이청아","이동건","전효성"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vgaokL1K7pIfWHXo0oUvLcX6kJq.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vgaokL1K7pIfWHXo0oUvLcX6kJq.jpg","air_date":"2023-06-30","episode_count":12,"overview":"N/A","vote_average":8.7,"episodes":{"1":{"name":"#alcança_a_fama","overview":"A influenciadora Seo A-ri choca a internet ao voltar à vida e revelar o segredo de sua ascensão meteórica e queda trágica.","air_date":"2023-06-30","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/7yJbSysiZ8z6e9nrYymbTaxp8nG.jpg","vote_average":8.4},"2":{"name":"#seguindo, seguidor","overview":"Uma empresa que administra a carreira de influenciadores vê potencial de sucesso em A-ri. Um telefonema da polícia faz A-ri reencontrar um admirador secreto.","air_date":"2023-06-30","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/gA5K6CdxwwYyczyHuqnyrXGSXGz.jpg","vote_average":8},"3":{"name":"#curtidas","overview":"Han Jun-kyoung socorre A-ri quando ela é humilhada pela Sociedade Gabin. A publicação de A-ri no instagram gera uma enxurrada de comentários negativos.","air_date":"2023-06-30","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/7vugOO4AtTc79PityWIAl9bd4bk.jpg","vote_average":10},"4":{"name":"#vamos_nos_conectar","overview":"A-ri faz amizade com uma seguidora misteriosa que a defende. As integrantes da Sociedade Gabin ficam furiosas com a ascensão meteórica de A-ri.","air_date":"2023-06-30","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/qSdq8AJlUqFiAm9eP9DJ1fGlghv.jpg","vote_average":0},"5":{"name":"#caixa_de_pandora #o_mundo_em_que_vivem","overview":"A-ri explora o maior distrito de compras da Coreia para começar uma nova empreitada profissional. Enquanto isso, uma noitada termina em caos.","air_date":"2023-06-30","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/98apgpH4GGlfYZFe1FQnBQz33U7.jpg","vote_average":10},"6":{"name":"#lamento_não_lamento #a_vida_é_injusta","overview":"Jin Tae-jeon tenta esconder o que Jin Chae-hee fez. A nova empreitada de A-ri começa a decolar, até que uma rival aparece em seu caminho.","air_date":"2023-06-30","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/6OkKw4BQPu0zjReOoqIZnfA2Qru.jpg","vote_average":5.5},"7":{"name":"#que_confusão #virar_o_jogo","overview":"A-ri tem um retorno triunfal para surpresa da Sociedade Gabin. Jun-kyoung tem uma atitude ousada com A-ri, mas será que a influenciadora vai topar?","air_date":"2023-06-30","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/yJrtpaC3MkJfUwJQqbCYfKl1iAd.jpg","vote_average":0},"8":{"name":"#hierarquia #o_mundo_em_que_vivemos","overview":"A-ri chega ao topo da hierarquia nas redes sociais. Yoon Si-hyeon precisa lidar com uma verdade perturbadora. Uma desconhecida procura A-ri com novidades.","air_date":"2023-06-30","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/8iFlSNkQxKsZIN0rL36fbtoQLtm.jpg","vote_average":0},"9":{"name":"#a_verdade_vence #entorna_o_chá","overview":"Tae-jeon continua fazendo o controle de danos. A-ri fecha um excelente negócio internacional e decide fazer o que é certo na vida pessoal.","air_date":"2023-06-30","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/ylamFoo24upbOfSvr25lZxApypf.jpg","vote_average":0},"10":{"name":"#preparem_as_pipocas","overview":"Uma ex-confidente e uma inimiga se unem para derrubar A-ri. Jun-kyoung jura que está do lado de A-ri, mas um evento terrível complica tudo.","air_date":"2023-06-30","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/dRT0saEtFTmkLs8weEMozYPgKzk.jpg","vote_average":0},"11":{"name":"#mas_ela_está_morta","overview":"Quando a tragédia atinge as pessoas que ela mais ama, é a gota d'água para A-ri. Si-hyeon dá uma notícia inesperada para Tae-jeon.","air_date":"2023-06-30","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/5Z1Ew10IJZGeMltGfRNBwJKCAyT.jpg","vote_average":0},"12":{"name":"#em_lugar_nenhum #mas_em_todo_lugar #como_voce_e_eu","overview":"A verdade sobre o desaparecimento de A-ri vem à tona, bem como a identidade de quem atormenta a influenciadora. Será que A-ri vai se vingar de uma vez por todas?","air_date":"2023-06-30","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/7eHQoboXPRMn0h1MDSYjBxXK2PS.jpg","vote_average":10}}}}},
