"247096":{"id":"247096","name":"ARA San Juan: O Submarino que Desapareceu","slug":"ara-san-juan-o-submarino-que-desapareceu","original_title":"ARA San Juan: El submarino que desapareció","overview":"Com entrevistas de especialistas e familiares, esta série documental investiga o trágico desaparecimento de um submarino militar em 2017.","first_air_date":"2024-03-07","episode_run_time":0,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Cactus Cine"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/1lcQDjk976x2mTJhPVCOAt1TV45.jpg","poster_path":"https://image.tmdb.org/t/p/original/xytXKYBrNW9z3kOfkxoRWqRwzkL.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2024-03-07","episode_count":8,"overview":"N/A","vote_average":7,"episodes":{"1":{"name":"O silêncio","overview":"O submarino ARA San Juan parte pela costa argentina para uma expedição. Mas o contato com a tripulação é perdido, e o paradeiro das 44 pessoas a bordo vira um mistério.","air_date":"2024-03-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/lKySAlmCjLHeETCeWKQkoFDkbwG.jpg","vote_average":7},"2":{"name":"A busca","overview":"A busca pelo ARA San Juan se transforma em uma operação internacional. Segredos vêm à tona, e o governo argentino encara as críticas das famílias das vítimas.","air_date":"2024-03-07","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/bRfqJsMj6ceGrtlMh36km0vEUgm.jpg","vote_average":0},"3":{"name":"A primeira verdade","overview":"As famílias sofrem com a perda dos 44 tripulantes. Surgem dúvidas sobre a confiabilidade do ARA San Juan e seu capitão.","air_date":"2024-03-07","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/4zVwB7mmYJWQuqtxCzYmkGpfTxJ.jpg","vote_average":0},"4":{"name":"A sujeira debaixo do tapete","overview":"A causa da implosão do ARA San Juan divide o governo e os investigadores. Surgem rumores de que o submarino foi atacado antes de desaparecer.","air_date":"2024-03-07","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/2xIPLi7rX53LQNgL3IBaYNFLcSW.jpg","vote_average":0},"5":{"name":"Não foi um acidente","overview":"Circulam teorias sobre a causa da implosão do submarino. Documentos confidenciais levantam a possibilidade de um ataque externo de um antigo inimigo.","air_date":"2024-03-07","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/pafSOy40fDGLjn1UpumzCs65st9.jpg","vote_average":0},"6":{"name":"Águas turvas","overview":"Acusações de espionagem ilegal aumentam a tensão entre as famílias dos tripulantes desaparecidos e o governo argentino.","air_date":"2024-03-07","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/t70Banb89rtQhi6VyI01T4i2OpE.jpg","vote_average":0},"7":{"name":"A última chance","overview":"Um ano depois do desaparecimento do submarino, restos do naufrágio são encontrados no oceano Atlântico. Mas o momento da descoberta desperta suspeitas.","air_date":"2024-03-07","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/ytSXvexCmLl0Hj59GBcAhRdpA9B.jpg","vote_average":0},"8":{"name":"A caixa preta","overview":"A descoberta dos destroços do submarino traz alívio para as famílias em luto, mas também desperta desconfiança em relação ao governo argentino.","air_date":"2024-03-07","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/9nQpbcM09sbWdlx2ZflsmMY9wiP.jpg","vote_average":0}}}}},
