"216089":{"id":"216089","name":"Companheiros de Viagem","slug":"companheiros-de-viagem","original_title":"Fellow Travelers","overview":"Uma crônica de décadas do relacionamento arriscado, volátil e sensual entre o carismático e ambicioso Hawk e o devoto e idealista Tim, dois servidores públicos que se apaixonam no auge do Terror Lilás dos anos 50.","first_air_date":"2023-10-29","episode_run_time":0,"vote_average":8.289,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Ron Nyswaner"],"production_companies":["Fremantle","Showtime Studios","Blue Days Films","Off-Season Productions"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/lfVx1vIkz4956ux7j38hG6D5nB.jpg","poster_path":"https://image.tmdb.org/t/p/original/lY8hmnVMTYCESraqlc6PtxprkE2.jpg","cast":["Matt Bomer","Jonathan Bailey","Jelani Alladin","Linus Roache","Noah J. Ricketts"],"trailer":"V72yglwGarU","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ca5dFdlge7sJ7gBwQA85J9yGcR6.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ca5dFdlge7sJ7gBwQA85J9yGcR6.jpg","air_date":"2023-10-29","episode_count":8,"overview":"N/A","vote_average":9.5,"episodes":{"1":{"name":"Você é Maravilhoso","overview":"Na Washington dos anos 50, Hawkins Fuller trabalha no Departamento de Estado, curtindo o sexo com homens e evitando envolvimento. Tudo muda quando Hawk começa um caso com Tim Laughlin. Em 1986, Hawk decide que precisa ver Tim.","air_date":"2023-10-29","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/741yOdABVOOlqtlM33rLlhkSw7h.jpg","vote_average":8.3},"2":{"name":"À Prova de Balas","overview":"Hawk se distancia de Tim quando o Departamento de Estado inicia investigações. Mary fica sob suspeita. Marcus perde o emprego após um conflito com Roy Cohn. Hawk se aproxima de Lucy Smith. Nos anos 80, Hawk observa a vida gay em meio à crise da AIDS.","air_date":"2023-11-05","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/71iDaokBzKF3MuSfLzSDCzBg4Fq.jpg","vote_average":9.3},"3":{"name":"Pode Bater em Mim","overview":"A viagem de Hawk e Tim azeda quando segundas intenções se revelam. Marcus e Frankie encontram um segurança racista. Roy tenta impedir que David seja convocado. Na São Francisco dos anos 80, Tim se recusa a perdoar até que uma emergência muda tudo.","air_date":"2023-11-12","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/A5q4e2ToajlujULDZnnreQVhijc.jpg","vote_average":9.444},"4":{"name":"Sua Batata Está Assando Numa Fogueira","overview":"Encarando um polígrafo sobre sua vida sexual, Hawk paquera Lucy. Marcus aceita sua atração por Frankie. Roy ameaça destruir o Exército quando David é convocado. Nos anos 80, Tim recruta Hawk para ajudar seu grupo de ativismo contra a AIDS.","air_date":"2023-11-19","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/a9Wgdu0PEFdgMWGlf8pLFVpceLc.jpg","vote_average":9.8},"5":{"name":"Prometa Que Não Vai Escrever","overview":"A obsessão de Roy Cohn por David Schine leva às audiências televisivas do Exército-McCarthy. Hawk tenta proteger Smith enquanto esconde sua vida secreta de Lucy. Exposto à natureza de McCarthy e de Hawk, Tim toma uma decisão que mudará sua vida.","air_date":"2023-11-26","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/fAYlGUM1AyE0WoF8LdzeMLK7egd.jpg","vote_average":9.4},"6":{"name":"Além da Medida","overview":"É 1968, e Tim é um manifestante antiguerra procurado pelo FBI. Hawk e Lucy têm dois filhos e uma casa de campo. Sem contato há anos, Hawk quer Tim de volta em sua vida. Tim, a caminho de se tornar padre, não consegue resistir aos encantos de Hawk.","air_date":"2023-12-03","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/hKfgEi9sHNBrY5smbPf2MOqWPj8.jpg","vote_average":9.8},"7":{"name":"Noites Brancas","overview":"É 1979, e Tim, agora assistente social, viaja para a Fire Island, onde Hawk o leva num passeio pelo \"paraíso gay\". Em São Francisco, Marcus e Frankie são atraídos para a fúria gay provocada pelo veredito do julgamento do homicídio de Dan White.","air_date":"2023-12-10","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/6KWaMIY5Uroll1Xnrye5Gfugkoi.jpg","vote_average":10},"8":{"name":"Facilite!","overview":"Em 1957, Hawk e Tim se reencontram no enterro do senador McCarthy e, pela última vez, tentam ficar juntos. Em São Francisco, em 1986, Hawk busca redenção. Já Tim toma uma decisão difícil que mudará a vida de Hawk para sempre.","air_date":"2023-12-17","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/kqQhqQnI3d6oHvPAfuxWmabiUvJ.jpg","vote_average":10}}}}},
